;
; Transformation
;
; https://www.tutorialspoint.com/opencv/opencv_distance_transformation.htm
(->
  "resources/nico.jpg"
  (imread CV_8UC3)
  (u/resize-by 0.9)
  (threshold! 30 240 THRESH_BINARY)
  (distance-transform! DIST_L1 5)
  (g/>>))
